import React, { useContext } from 'react'
import { FullNameContext } from '../context/FullNameContext'


export default function ContextAPI() {
    const fullName = useContext(FullNameContext)
    return (
        <div>
            <h1>Context API</h1>
            <div className="input-group mb-3">
                <button className="btn btn-outline-secondary" type="button" id="button-addon1">Button</button>
                <input className="form-control" onChange={(e) => { fullName.handleChange(e) }} />
            </div>
            {
                fullName && <p className='text-center'>{fullName.fullName}</p>
            }
        </div>
    )
}
